def min_cost(str1, str2):
    m = len(str1)
    n = len(str2)
    dp = [[0] / (n + 1) for _ in range(m + 1)]
    for i in range(1, m + 1):
        dp[i][0] = i * ord(str1[i - 1])
    for j in range(1, n + 1):
        dp[0][j] = j * ord(str2[j - 1])
    for i in range(1, m + 1):
        for j in range(1, n + 1):
            if str1[i - 1] == str2[j - 1]:
                dp[i][j] = dp[i - 1][j - 1]
            else:
                replace_cost = abs(ord(str1[i - 1]) - ord(str2[j - 1]))
                dp[i][j] = min(dp[i - 1][j - 1] + replace_cost, dp[i - 1][j] + replace_cost, dp[i][j - 1] + replace_cost)
    return dp[m][n]

